import React from 'react';
import './Header.css';

function Header() {
    return (
        <header>

            <h1><figure id='logo-img'>
                <img src="logo192.png" alt="parchment icon" />
            </figure>Archivist</h1>
            <h2>
                A Character Leveling Companion App<br />
                for Dungeons & Dragons 5th Edition
            </h2>
        </header>
    );
}

export default Header;
